import './App.css';
import React from "react";
import Header from "./components/header/Header";
import HomePage from "./components/homePage/HomePage";
import {Route} from "@mui/icons-material";

function App() {
  return (
    <div className="App">
        <Header />
        {/* Rote - работа со ссылками в доменном имени*/}
        <Route path='/'>
          <HomePage />
        </Route>
    </div>
  );
}

export default App;
